import { Helper } from '../../../../classes/Helper';

interface RouteItem {
  id: number,
  public: number,
  title: string,
  country_code: string,
  city: string,
  image: string,
  grade: number,
  distance: number
}

@Component({
  selector: 'page-routes-list',
  templateUrl: 'RoutesList.html'
})
export class RoutesListPage {
  public items: Array<RouteItem> = new Array<RouteItem>();

  constructor(public navCtrl: NavController) {

  }

  ionViewDidEnter() {
    this.getItems().then(items => this.items = items);
  }

  async getItems(): Promise<Array<RouteItem>> {
    return new Promise<Array<RouteItem>>(resolve => {
      console.log("getting items for list")
      let items = [];
      for (let i:number = 0; i < 10; i++) {
        let routeItem: RouteItem = {
          id: i,
          public: 1,
          title: `Title${i}`,
          country_code: 'DE',
          city: 'Frankfurt',
          image: 'data:image/jpeg;base64,',
          grade: Math.round(Math.random() * 5 + 5),
          distance: Math.round(Math.random() * 10000)
        };

        items.push(routeItem);
      }

      resolve(items);
    });

    
    // 2 - public
    // 3 - title
    // 4 - country_code
    // 5 - city
    // 6 - image
    // 8 - grade
  }
}
